def get_prime_numbers(n):
    limit = 1001
    while True:
        is_prime = [True] * (limit + 1)
        is_prime[0] = False
        is_prime[1] = False
        for p in range(2, int(math.sqrt(limit)) + 1):
            if is_prime[p]:
                for i in range(p * p, limit + 1, p):
                    is_prime[i] = False
        prime_numbers = []
        for i in range(2, limit + 1):
            if is_prime[i]:
                prime_numbers.append(i)
                if len(prime_numbers) == n:
                    return prime_numbers
        limit *= 2

